sourcesContent:
const grocery = [
  {
    id: '1',
    name: 'ABC Market',
    ingredients: 'Carrot',
    price: 1,
    image: require('../assets/catergories/carrot.jpg'),
  },
  {
    id: '2',
    name: 'Tekka Market',
    ingredients: 'Broccoli',
    price: 2.10,
    image: require('../assets/catergories/broccoli.jpg'),
  },
  {
    id: '3',
    name: 'Tekka Market',
    ingredients: 'Egg plant',
    price: 1.10,
    image: require('../assets/catergories/eggplant.jpg'),
  },
  {
    id: '4',
    name: 'Tekka Market',
    ingredients: 'Red Capsicum',
    price: 2.00,
    image: require('../assets/catergories/red_cap.jpg'),
  },
];

export default grocery;
